import React, { useState, useEffect } from 'react';

const MarksForm = () => {
  const [marks, setMarks] = useState({
    telugu: '',
    hindi: '',
    english: '',
    maths: '',
    science: '',
    social: '',
    studentId: {
      studentId: ''
    }
  });

  const [students, setStudents] = useState([]);

  useEffect(() => {
    fetchStudents();
  }, []);

  const fetchStudents = async () => {
    try {
      const response = await fetch('http://localhost:8080/showAllStudents');
      if (response.ok) {
        const data = await response.json();
        setStudents(data);
      } else {
        console.error('Error fetching students');
      }
    } catch (error) {
      console.error('Network error:', error);
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await fetch('http://localhost:8080/addMarks', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(marks)
      });

      if (response.ok) {
        console.log('Marks data submitted successfully');
        setMarks({
          telugu: '',
          hindi: '',
          english: '',
          maths: '',
          science: '',
          social: '',
          studentId: {
            studentId: ''
          }
        });
      } else {
        console.error('Error submitting marks data');
      }
    } catch (error) {
      console.error('Network error:', error);
    }
  };

  return (
    <div className="marks-form-container">
      <form onSubmit={handleSubmit}>
        <div className="form-field">
          <label htmlFor="telugu">Telugu:</label>
          <input
            type="text"
            id="telugu"
            value={marks.telugu}
            onChange={(event) =>
              setMarks({ ...marks, telugu: event.target.value })
            }
            required
          />
        </div>

        <div className="form-field">
          <label htmlFor="hindi">Hindi:</label>
          <input
            type="text"
            id="hindi"
            value={marks.hindi}
            onChange={(event) =>
              setMarks({ ...marks, hindi: event.target.value })
            }
            required
          />
        </div>

        <div className="form-field">
          <label htmlFor="english">English:</label>
          <input
            type="text"
            id="english"
            value={marks.english}
            onChange={(event) =>
              setMarks({ ...marks, english: event.target.value })
            }
            required
          />
        </div>

        <div className="form-field">
          <label htmlFor="maths">Maths:</label>
          <input
            type="text"
            id="maths"
            value={marks.maths}
            onChange={(event) =>
              setMarks({ ...marks, maths: event.target.value })
            }
            required
          />
        </div>

        <div className="form-field">
          <label htmlFor="science">Science:</label>
          <input
            type="text"
            id="science"
            value={marks.science}
            onChange={(event) =>
              setMarks({ ...marks, science: event.target.value })
            }
            required
          />
        </div>

        <div className="form-field">
          <label htmlFor="social">Social:</label>
          <input
            type="text"
            id="social"
            value={marks.social}
            onChange={(event) =>
              setMarks({ ...marks, social: event.target.value })
            }
            required
          />
        </div>

        <div className="form-field">
          <label htmlFor="studentId">Student:</label>
          <select
            id="studentId"
            value={marks.studentId.studentId}
            onChange={(event) =>
              setMarks({
                ...marks,
                studentId: { studentId: event.target.value }
              })
            }
            required
          >
            <option value="">Select a student</option>
            {students.map((student) => (
              <option key={student.id} value={student.id}>
                {student.name}
              </option>
            ))}
          </select>
        </div>

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default MarksForm;
